import React from 'react';
import './Home.css';
import Header from '../components/Header';


function Home() {
    return (
        <div>
          <Header />
          <div className="home-container">
          <img className="img-1" src={require('./dmitry-shamis-uaufwPBhbio-unsplash.jpg').default} alt="blizzard" height={300} width={200} />
            <p className="img-1-txt">this is a paragraph</p>
            <img className="img-2" src={require('./dmitry-shamis-uaufwPBhbio-unsplash.jpg').default} alt="Jumping" width={100} height={200} />
            <p className="img-2-txt">this is another paragraph</p>
            <img src={require('./arvid-skywalker-h6ccJcVHh20-unsplash.jpg')} alt="" width={200} height={400} />
          </div>

        </div>
    )
}

export default Home
